import json
import numpy as np
import matplotlib.pyplot as plt

results = json.loads(results)

r = np.zeros((10,1))
r[0] = float('NaN')

for p in results:
    #print(results[r])
    min_l = float('inf')
    min_a = float('inf')
    for l, a in results[p].items():
        if abs(a) < abs(min_a):
            min_a = abs(a)
            min_l = l
            r[int(p)]=min_a
    print(p, "\t", min_l, "\t", min_a)


plt.plot(r)
plt.xlabel("p")
plt.ylabel("Error")

plt.show()
plt.close()

ls = []
accs = []
data = results["1"]
for l, a in data.items():
    ls.append(l)
    accs.append(a)

ls = np.array(ls)
accs = np.array(accs)

mask = ls.argsort()
ls = ls[mask[::-1]]
accs = accs[mask[::-1]]

fig = plt.figure()
ax = plt.gca()
ax.scatter(ls, accs)
